import React from 'react'
import Lo from './Login.module.css';
import { Link } from "react-router-dom";
import Logo21 from "./Components/Images/logo22.png";
import { useState } from 'react';
import axios from "axios";
export default function Login() {
  const [name,setname] = useState('');
  const [mobileno,setmobileno] = useState('');
  const handlesubmit = (e)=>{
    axios.post("http://localhost:8000/login",{
      name,
      mobileno
    })
  }
  return (
    <div>
    <img src={Logo21} alt='Logo' className={Lo.imggs}/>
      <div className={Lo.mncont}>
        <lable className={Lo.lab}>Mobile Number : </lable>
        <input type='number' className={Lo.input1} onChange={(e)=>{setname(e.target.value)}} placeholder='Enter Your Mobile Number' required></input>
        <lable className={Lo.lab}>Name : </lable>
        <input type='text' className={Lo.input1} onChange={(e)=>{setmobileno(e.target.value)}}  placeholder='Enter Your Name' required></input>
        <Link to="/Main" className={Lo.lk} type='submit' onClick={handlesubmit}>Create Profile</Link>
      </div>
    </div>
  )
}
